import React from "react";

function Welcome(props) {
    const { name = "Guest", age } = props;

    return (
        <div>
            <p>Hello, {name}!</p>
            {age > 18 && age < 65 && name === "John" && (
                <p>Your age is {age}</p>
            )}
            {!(age > 18 && age < 65 && name === "John") && (
                <p>You are very young!</p>
            )}
        </div>
    );
}

export default Welcome;
